create database pi;
USE pi;

CREATE TABLE listas_equipamentos (
    ID INTEGER NOT NULL,
    UNIDADE_ESPORTIVA VARCHAR(55) NOT NULL,
    TIPO VARCHAR(31) NOT NULL,
    TIPO_ADMINISTRACAO VARCHAR(10) NOT NULL,
    SITUACAO VARCHAR(10) NOT NULL,
    PREFEITURA_REGIONAL VARCHAR(25) NOT NULL,
    DISTRITO VARCHAR(17) NOT NULL,
    EQUIPAMENTOS VARCHAR(24) NOT NULL,
    QUANTIDADE_DE_EQUIPAMENTOS_DA_UNIDADE INTEGER NOT NULL,
    PRIMARY KEY (ID)
);

create table cadastro_de_usuarios(
	ID_USUARIO integer not null auto_increment,
	NOME varchar (30) not null,
	EMAIL varchar (50) not null,
	SENHA varchar (30) not null,
	CPF varchar (11) not null,
	primary key (ID_USUARIO)
);

create table operacao (
ID_OPERACAO integer not null auto_increment,
ID_EQUIPAMENTO integer not null,
ID_USUARIO integer not null,
HORA_INICIAL TIME not null,
PRIMARY KEY (ID_OPERACAO),
FOREIGN KEY (ID_EQUIPAMENTO) REFERENCES listas_equipamentos(ID),
FOREIGN KEY (ID_USUARIO) REFERENCES cadastro_de_usuarios(ID_USUARIO)
);




